window.bookSummaryJSON = "<p>A locked-room mystery in a near-future world of politics and alien diplomacy.&nbsp;</p> <p>Lydia works as translator for the Logi cultural attaché to Earth. They work well together, even if the act of translating his thoughts into English makes her somewhat wobbly on her feet. She’s not the agency’s best translator, but what else is she going to do? She has no qualifications and no discernible talent in any other field. So when tragedy strikes and Lydia finds herself at the center of an intergalactic incident, her future employment prospects look dire—that is, if she can keep herself out of jail! But Lydia soon discovers that help can appear from the most unexpected source....</p>"; 
